import { useEffect, useState } from "react";
import { useHistory } from "react-router-dom";
import Card from "../components/UI/Card";
import api, { call } from "../api/api";
import { toStandard, toUpperFirstCase } from "../utils/string";

const Products = () => {
  const history = useHistory();

  // Render component
  return (
    <div className="products px-3 py-5">
      <h5>Live chat</h5>
      <Card className="mt-4 p-3 row">
        <div className="col">Chat list</div>
        <div className="col">Chatting</div>
      </Card>
    </div>
  );
};

export default Products;
